import PropTypes from 'prop-types';
import classNames from 'classnames';

import Block from '../components/block';
import List from '../components/list';
import Link from '../components/link';

class Details extends React.Component {
  renderTravel() {
    return (
      <div className='details-travel'>
        <h4>Travel Details</h4>
        <Block blockTitle='Accomodations'>
          Gumbo beet greens corn soko endive gumbo gourd. Parsley shallot courgette tatsoi pea sprouts fava bean collard greens dandelion okra wakame tomato.
        </Block>
        <Block blockTitle='Parking & Transportation'>
          Gumbo beet greens corn soko endive gumbo gourd. Parsley shallot courgette tatsoi pea sprouts fava bean collard greens dandelion okra wakame tomato.
        </Block>
        <style jsx>{`
          .details-travel {
            margin-bottom: 24px;
          }
          .details-travel h4 {
            margin-bottom: 24px;
          }
        `}</style>
      </div>
    )
  }

  renderRegistry() {
    return (
      <div className='details-registry'>
        <h4>Registry</h4>
        <h6>Online</h6>
        <List>
          <List.Item><Link linkTo=''>Zola</Link></List.Item>
          <List.Item><Link linkTo=''>Crate & Barrel</Link></List.Item>
          <List.Item><Link linkTo=''>TBD</Link></List.Item>
        </List>
      </div>
    )
  }
  render() {
    return (
      <div className='details'>
        { this.renderTravel() }
        { this.renderRegistry() }
        <style jsx>{`
          .details {
            grid-area: details;
          }
        `}</style>
      </div>
    )
  }

}

export default Details
